import webpageImg from "./../images/portfolio/websiteImg.png";

//import images/portfolio";
export default function Card() {
  return (
    <div className="cardMain">
      <div className="title">This Website</div>
      <br></br>
      <img className="image" src={webpageImg}></img>
    </div>
  );
}
